import React from "react";
import { GCULogoLong } from "./GCULogoLong";
import { GCU_COLOR, PURPLE_GRADIENT } from "./theme";

const SPACING = "12px";

export const GCUStudentIdCard = () => {
  return (
    <div
      style={{
        background: GCU_COLOR.white,
        height: "100vh",
        padding: SPACING,
      }}
    >
      <div>
        <div
          style={{
            background: PURPLE_GRADIENT,
          }}
        >
          <div
            style={{
              margin: "auto",
              padding: SPACING,
              width: "66.66%",
            }}
          >
            <GCULogoLong />
          </div>
        </div>
        <div style={{ padding: `calc(${SPACING} * 2)` }}></div>
        <div
          style={{
            background: PURPLE_GRADIENT,
          }}
        >
          <div
            style={{
              margin: "auto",
              padding: SPACING,
              width: "66.66%",
            }}
          >
            <GCULogoLong />
          </div>
        </div>
      </div>
    </div>
  );
};
